a></a><br/></b></p> <p>\n\n\n<b>OBS: TODAS QUE COMPARECEREM AO MEET UP IRÃO GANHAR \" VOUCHER\" PARA TER ACESSO A UMA CONTA DREAMSPARK </b>( Programa da Microsoft que dá suporte a educação técnica fornecendo acesso a software da Microsoft para fins de aprendizado, ensino e pesquisa.) Além disso vai poder publicar seus app para windows 8 ou windows phone.</p> <p><a href=\"https://www.dreamspark.com/\"><a href=\"https://www.dreamspark.com/\" class=\"linkified\">https://www.dreamspark.com/</a></a></p> <p><br/>* Recomendação: Preparar o ambiente de desenvolvimento Instalando o visual studio 2013 Express. </p> <p><b>Obs: Informamos que na cafeteria tem ambiente climatizado, Wi-FI e DataShow, cada participante pagará apenas R$ 25,00 ( para consumo de café, tortas e bolos, )</b></p> <p>\n\n\nAguardamos vocês!!!</p> <p>Grande Abraço,<br/>Karina, Josilene e Lhaís.</p>", meetup_event_id: "rscnflyvcbmb", time_zone: nil, hex_color: "#00b5a9"},
