  {featured: false, network_id: nil, updatedAt: nil, url: "http://www.meetup.com/Women-Who-Code-Atlanta/events/rgqlflytqbvb/", event_date: "2015-12-16 23:30:00 UTC", location: "Cycore Systems", title: "Women iOS Developers Group", subscribe_count: nil, createdAt: "2015-10-24", description: nil, meetup_event_id: "rgqlflytqbvb", time_zone: nil, hex_color: "#00b5a9"},
  {featured: false, network_id: nil, updatedAt: nil, url: "http://www.meetup.com/Women-Who-Code-Recife/events/rscnflytpblc/", event_date: "2015-11-28 17:00:00 UTC", location: "Café Café", title: "Meet up Study Group C#", subscribe_count: nil, createdAt: "2015-10-18", description: "<p>Novo grupo de estudo de c# do Women Who Vode - Recife, vamos juntas aprender a programar para uma linguagem que está no mercado de trabalho. Todas serão bem-vindas independente qual for o seu nível de conhecimento , mas vamos iniciar como beginner. </p> <p>Nesse grupo de estudo o mais importante é você ir no seu próprio ritmo! você pode usar qualquer material de sua preferência e  sinta-se a vontade de compartilhar o seu conhecimento com o grupo.</p> <p>Relacionamos alguns links como base de estudo:</p> <p>• <a href=\"http://www.microsoftvirtualacademy.com/\"><a href=\"http://www.microsoftvirtualacademy.com/\" class=\"linkified\">http://www.microsoftvirtualacademy.com/</a></a></p> <p>• <a href=\"http://www.codecademy.com/pt\"><a href=\"http://www.codecademy.com/pt\" class=\"linkified\">http://www.codecademy.com/pt</a></a></p> <p>• <a href=\"https://pt.khanacademy.org/\"><a href=\"https://pt.khanacademy.org/\" class=\"linkified\">https://pt.khanacademy.org/</a></a></p> <p>• <a href=\"http://channel9.msdn.com/\"><a href=\"http://channel9.msdn.com/\" class=\"linkified\">http://channel9.msdn.com/</a></a></p> <p>• <a href=\"http://www.pluralsight.com/\"><a href=\"http://www.pluralsight.com/\" class=\"linkified\">http://www.pluralsight.com/</a></a></p> <p><b>Livro: </b></p> <p>• Use a Cabeça C#: Editora: Alta Books<br/>   Autor:Andrew Stellamn</p> <p><br/><b>Software:</b></p> <p><b>Visual Studio 2013 Express : Gratuita</b></p> <p><b><a href=\"http://www.visualstudio.com/en-us/products/visual-studio-express-vs.aspx\"><a href=\"http://www.visualstudio.com/en-us/products/visual-studio-express-vs.aspx\" class=\"linkified\">http://www.visualstudio.com/en-us/products/visual-studio-express-vs.aspx</a></a><br/></b></p> <p>\n\n\n<b>OBS: TODAS QUE COMPARECEREM AO MEET UP IRÃO GANHAR \" VOUCHER\" PARA TER ACESSO A UMA CONTA DREAMSPARK </b>( Programa da Microsoft que dá suporte a educação técnica fornecendo acesso a software da Microsoft para fins de aprendizado, ensino e pesquisa.) Além disso vai poder publicar seus app para windows 8 ou windows phone.</p> <p><a href=\"https://www.dreamspark.com/\"><a href=\"https://www.dreamspark.com/\" class=\"linkified\">https://www.dreamspark.com/</a></a></p> <p><br/>* Recomendação: Preparar o ambiente de desenvolvimento Instalando o visual studio 2013 Express. </p> <p><b>Obs: Informamos que na cafeteria tem ambiente climatizado, Wi-FI e DataShow, cada participante pagará apenas R$ 25,00 ( para consumo de café, tortas e bolos, )</b></p> <p>\n\n\nAguardamos vocês!!!</p> <p>Grande Abraço,<br/>Karina, Josilene e Lhaís.</p>", meetup_event_id: "rscnflytpblc", time_zone: nil, hex_color: "#00b5a9"},
